donusrs\" ]; then","  echo -e \"\\e[00;31m[-] Users that have previously logged onto the system:\\e[00m\\n$lastlogedonusrs\" ","  echo -e \"\\n\" ","fi","","#who else is logged on","loggedonusrs=`w 2\u003e/dev/null`","if [ \"$loggedonusrs\" ]; then","  echo -e \"\\e[00;31m[-] Who else is logged on:\\e[00m\\n$loggedonusrs\" ","  echo -e \"\\n\"","fi","","#lists all id's and respective group(s)","grpinfo=`for i in $(cut -d\":\" -f1 /etc/passwd 2\u003e/dev/null);do id $i;done 2\u003e/dev/null`","if [ \"$grpinfo\" ]; then","  echo -e \"\\e[00;31m[-] Group memberships:\\e[00m\\n$grpinfo\"","  echo -e \"\\n\"","fi","","#added by phackt - look for adm group (thanks patrick)","adm_users=$(echo -e \"$grpinfo\" | grep \"(adm)\")","if [[ ! -z $adm_users ]];","  then","    echo -e \"\\e[00;31m[-] It looks like we have some admin users:\\e[00m\\n$adm_users\"","    echo -e \"\\n\"","fi","","#checks to see if any hashes are stored in /etc/passwd (depreciated  *nix storage method)","hashesinpasswd=`grep -v '^[^:]*:[x]' /etc/passwd 2\u003e/dev/null`","if [ \"$hashesinpasswd\" ]; then","  echo -e \"\\e[00;33m[+] It looks like we have password hashes in /etc/passwd!\\e[00m\\n$hashesinpasswd\" ","  echo -e \"\\n\"","fi","","#contents of /etc/passwd","readpasswd=`cat /etc/passwd 2\u003e/dev/null`","if [ \"$readpasswd\" ]; then","  echo -e \"\\e[00;31m[-] Contents of /etc/passwd:\\e[00m\\n$readpasswd\" ","  echo -e \"\\n\"","fi","","if [ \"$export\" ] \u0026\u0026 [ \"$readpasswd\" ]; then","  mkdir $format/etc-export/ 2\u003e/dev/null","  cp /etc/passwd $format/etc-export/passwd 2\u003e/dev/null","fi","","#checks to see if the shadow file can be read","readshadow=`cat /etc/shadow 2\u003e/dev/null`","if [ \"$readshadow\" ]; then","  echo -e \"\\e[00;33m[+] We can read the shadow file!\\e[00m\\n$readshadow\" ","  echo -e \"\\n\"","fi","","if [ \"$export\" ] \u0026\u0026 [ \"$readshadow\" ]; then","  mkdir $format/etc-export/ 2\u003e/dev/null","  cp /etc/shadow $format/etc-export/shadow 2\