\" ]; then","      :","    else","      sudopermscheck=`echo $userpassword | sudo -S -l -k 2\u003e/dev/null | xargs -n 1 2\u003e/dev/null|sed 's/,*$//g' 2\u003e/dev/null | grep -w $binarylist 2\u003e/dev/null`","      if [ \"$sudopermscheck\" ]; then","        echo -e \"\\e[00;33m[-] Possible sudo pwnage!\\e[00m\\n$sudopermscheck\" ","        echo -e \"\\n\"","      fi","    fi","fi","","#known 'good' breakout binaries (cleaned to parse /etc/sudoers for comma separated values)","sudopwnage=`echo '' | sudo -S -l -k 2\u003e/dev/null | xargs -n 1 2\u003e/dev/null | sed 's/,*$//g' 2\u003e/dev/null | grep -w $binarylist 2\u003e/dev/null`","if [ \"$sudopwnage\" ]; then","  echo -e \"\\e[00;33m[+] Possible sudo pwnage!\\e[00m\\n$sudopwnage\" ","  echo -e \"\\n\"","fi","","#who has sudoed in the past","whohasbeensudo=`find /home -name .sudo_as_admin_successful 2\u003e/dev/null`","if [ \"$whohasbeensudo\" ]; then","  echo -e \"\\e[00;31m[-] Accounts that have recently used sudo:\\e[00m\\n$whohasbeensudo\" ","  echo -e \"\\n\"","fi","","#checks to see if roots home directory is accessible","rthmdir=`ls -ahl /root/ 2\u003e/dev/null`","if [ \"$rthmdir\" ]; then","  echo -e \"\\e[00;33m[+] We can read root's home directory!\\e[00m\\n$rthmdir\" ","  echo -e \"\\n\"","fi","","#displays /home directory permissions - check if any are lax","homedirperms=`ls -ahl /home/ 2\u003e/dev/null`","if [ \"$homedirperms\" ]; then","  echo -e \"\\e[00;31m[-] Are permissions on /home directories lax:\\e[00m\\n$homedirperms\" ","  echo -e \"\\n\"","fi","","#looks for files we can write to that don't belong to us","if [ \"$thorough\" = \"1\" ]; then","  grfilesall=`find / -writable ! -user \\`whoami\\` -type f ! -path \"/proc/*\" ! -path \"/sys/*\" -exec ls -al {} \\; 2\u003e/dev/null`","  if [ \"$grfilesall\" ]; then","    echo -e \"\\e[00;31m[-] Files not owned by user but writable by group:\\e[00m\\n$grfilesall\" ","    echo -e \"\\n\"","  fi","fi","","#looks for files that belong to us","if [ \"$thorough\" = \"1\" ]; then","  ourfilesall=`find / -user \\`whoami\\` -type f ! -path \"/proc/*\" ! -path \"/sys/*\" -exec ls -al {} \\; 2\u003e/dev/null`","  if [ \"$ourfilesall\" ]; then","    echo -e \"\\e[00;31m[-] Files owned by our user:\\e[00m\\n$ourfilesall\"","    echo -e \"\\n\"","  fi","fi","","#looks for hidden files","if [ \"$thorough\" = \"1\" ]; then","  hiddenfiles=`find / -name \".*\" -type f ! -path \"/proc/*\" ! -path \"/sys/*\" -exec ls -al {} \\; 2\u003e/dev/null`","  if [ \"$hiddenfiles\" ]; then","    echo -e \"\\e[00;31m[-] Hidden files:\\e[00m\\n$hiddenfiles\"","    echo -e \"\\n\"","  fi","fi","","#looks for world-reabable files within /home - depending on number of /home dirs \u0026 files, this can take some time so is only 'activated' with thorough scanning switch","if [ \"$thorough\" = \"1\" ]; then","wrfileshm=`find /home/ -perm -4 -type f -exec ls -al {} \\; 2\u003e/dev/null`","\tif [ \"$wrfileshm\" ]; then","\t\techo -e \"\\e[00;31m[-] World-readable files within /home:\\e[00m\\n$wrfileshm\" ","\t\techo -e \"\\n\"","\tfi","fi","","if [ \"$thorough\" = \"1\" ]; then","\tif [ \"$export\" ] \u0026\u0026 [ \"$wrfileshm\" ]; then","\t\tmkdir $format/wr-files/ 2\u003e/dev/null","\t\tfor i in $wrfileshm; do cp --parents $i $format/wr-files/ ; done 2\u003e/dev/null","\tfi","fi","","#lists current user's home directory contents","if [ \"$thorough\" = \"1\" ]; then","homedircontents=`ls -ahl ~ 2\u003e/dev/null`","\tif [ \"$homedircontents\" ] ; then","\t\techo -e \"\\e[00;31m[-] Home directory contents:\\e[00m\\n$homedircontents\" ","\t\techo -e \"\\n\" ","\tfi","fi","","#checks for if various ssh files are accessible - this can take some time so is only 'activated' with thorough scanning switch","if [ \"$thorough\" = \"1\" ]; then","sshfiles=`find / \\( -name \"id_dsa*\" -o -name \"id_rsa*\" -o -name \"known_hosts\" -o -name \"authorized_hosts\" -o -name \"authorized_keys\" \\) -exec ls -la {} 2\u003e/dev/null \\;`","\tif [ \"$sshfiles\" ]; 