ning under","apacheusr=`grep -i 'user\\|group' /etc/apache2/envvars 2\u003e/dev/null |awk '{sub(/.*\\export /,\"\")}1' 2\u003e/dev/null`","if [ \"$apacheusr\" ]; then","  echo -e \"\\e[00;31m[-] Apache user configuration:\\e[00m\\n$apacheusr\" ","  echo -e \"\\n\"","fi","","if [ \"$export\" ] \u0026\u0026 [ \"$apacheusr\" ]; then","  mkdir --parents $format/etc-export/apache2/ 2\u003e/dev/null","  cp /etc/apache2/envvars $format/etc-export/apache2/envvars 2\u003e/dev/null","fi","","#installed apache modules","apachemodules=`apache2ctl -M 2\u003e/dev/null; httpd -M 2\u003e/dev/null`","if [ \"$apachemodules\" ]; then","  echo -e \"\\e[00;31m[-] Installed Apache modules:\\e[00m\\n$apachemodules\" ","  echo -e \"\\n\"","fi","","#htpasswd check","htpasswd=`find / -name .htpasswd -print -exec cat {} \\; 2\u003e/dev/null`","if [ \"$htpasswd\" ]; then","    echo -e \"\\e[00;33m[-] htpasswd found - could contain passwords:\\e[00m\\n$htpasswd\"","    echo -e \"\\n\"","fi","","#anything in the default http home dirs (a thorough only check as output can be large)","if [ \"$thorough\" = \"1\" ]; then","  apachehomedirs=`ls -alhR /var/www/ 2\u003e/dev/null; ls -alhR /srv/www/htdocs/ 2\u003e/dev/null; ls -alhR /usr/local/www/apache2/data/ 2\u003e/dev/null; ls -alhR /opt/lampp/htdocs/ 2\u003e/dev/null`","  if [ \"$apachehomedirs\" ]; then","    echo -e \"\\e[00;31m[-] www home dir contents:\\e[00m\\n$apachehomedirs\" ","    echo -e \"\\n\"","  fi","fi","","}","","interesting_files()","{","echo -e \"\\e[00;33m### INTERESTING FILES ####################################\\e[00m\" ","","#checks to see if various files are installed","echo -e \"\\e[00;31m[-] Useful file locations:\\e[00m\" ; which nc 2\u003e/dev/null ; which netcat 2\u003e/dev/null ; which wget 2\u003e/dev/null ; which nmap 2\u003e/dev/null ; which gcc 2\u003e/dev/null; which curl 2\u003e/dev/null ","echo -e \"\\n\" ","","#limited search for installed compilers","compiler=`dpkg --list 2\u003e/dev/null| grep compiler |grep